        query = '''{
           leaderboard{
             season(request:{leaderBoardDivision:%s}){
               players(take:100, skip:%s){
                 steamAccount{
                   isAnonymous
                   id
                   name
               }
               }}
           }
         }''' % (region, skip)
        headers = {"Authorization": f"Bearer {api_token_1}"}
